import {createMuiTheme} from '@material-ui/core';
import "typeface-forum";

export const theme = createMuiTheme({
  typography: {
    fontFamily: [
      'Forum',
      '-apple-system',
      'BlinkMacSystemFont',
      'Arial',
      'sans-serif'
    ]
  }
});
